impl Solution {
    pub fn area_of_max_diagonal(dimensions: Vec<Vec<i32>>) -> i32 {
        let mut max_diagonal = 0f64;
        let mut max_area = 0;

        for dim in dimensions {
            let length = dim[0];
            let width = dim[1];
            let diagonal = ((length.pow(2) + width.pow(2)) as f64).sqrt();
            let area = length * width;

            // Update max_diagonal and max_area if a larger diagonal is found,
            // or if the diagonal is equal but the area is larger.
            if diagonal > max_diagonal || (diagonal == max_diagonal && area > max_area) {
                max_diagonal = diagonal;
                max_area = area;
            }
        }

        max_area
    }
}
